import { useEffect, useState } from 'react'
import "./Requests.css"

export const AddNotes = ({ id }) => {

    const [notes, setNotes] = useState({
        contacted: false
    })

    useEffect(
        () => {
            fetch(`http://localhost:8088/requests?isAccepted=true`)
                .then(response => response.json())
                .then((staffNotes) => {
                    setNotes(staffNotes)
                })
        }, []
    )



    return (
        <>
            <div htmlFor="email"> Add Notes: </div>
            <form>
                <textarea
                    onchange="alert('You just changed the textarea.')"
                    placeholder="Add notes...">
                </textarea>
            </form>



        </>
    )
}

